Cloud Integration 

This service is a natural extension of our systems integration services and includes the design\, implementation and testing of interfaces between cloud computing components (SaaS\, PaaS and IaaS) and on-premise technology.  It includes:

? Design of custom interfaces between cloud and on-premise technology;

? Development of custom integration between published cloud APIs and existing technology components\, or between multiple divers cloud deployments;

? Development of extensions to SaaS products and services to provide additional functionality or capability;

? Development of customised solutions to provide extended functionality to complement deployed cloud services.

Amethyst standard training courses includes:
An Overview of Information Assurance;
IAS1 Practitioners ?  an in-depth understanding of the of HMG IAS No.1 - Technical Risk Assessment (Parts 1 & 2);
RMADS Introduction ? an in depth understanding of HMG IAS 2 ? Risk Management and Accreditation of ICT Systems and Services and guidance on the production of a Risk Management and Accreditation Document Set (RMADS);
Understanding technology Enabled Crime ? an in depth understanding of how criminals exploit technology in the furtherance of crime; the range of technological tools and techniques available to investigators.
All courses can be adapted and other courses are availabe on request.

The Amethyst Cryptographic Services Ltd (ACS) Managed Encryption Service (MES) provides cryptography as a managed utility or commodity service. This delivers a number of business benefits: 
*  It can be used to provide a technical control against aggregation of data;
* It allows the use of shared SAN disc arrays within a data centre (when used in conjunction with Transparent Disk Encryption (TDE));
 * It can be deployed as a gateway between two systems working at different Impact levels; 
* It supports the HMG G-Cloud initiative by providing a centrally managed encryption service to applications running in virtual machine on clustered data centres.

